  true,\n\t\"url\": null,\n\t\"notes\": \"The San Diego data environment contains:
  (a) One year of raw and cleaned data for over 3,000 traffic detectors deployed along
  1,250 lane miles of I-5 in San Diego, including 30-second raw reports and 5-minute,
  hourly, and daily aggregations, (b) Cleaned and geographically referenced data for
  over 1,500 incidents and lane closures for the two sections of I-5 that experienced
  the greatest number of incidents during 2010, (c) Complete trip (origin-to-destination)
  GPS \"breadcrumbs\" containing latitude/longitude, vehicle heading and speed data,
  and time for individual in-vehicles devices updated at 3-second intervals for 10,000
  trips taken during 2010, and (d) Weather data from seven weather stations in the
  San Diego area.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
